import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

export default function Home({ items }) {
  return (
    <Carousel>
      {items.map((item, index) => (
        <div key={index}>
          {item}
        </div>
      ))}
    </Carousel>
  );
}
